import React from "react";

const trending = () => {
  return (
    <section className="trending w-full flex justify-center py-10">
      <div className="wrapper container">
        <h3 className="text-center">Trending</h3>
        <h5 className="text-center">Top view in this week</h5>
        <div className="product_container grid grid-cols-4">
          <div className="product-col border border-black">
            <img
              src="https://zandokh.com/image/cache/catalog/products/2023-01/2222301060/Floral-Dress%20(3)-cr-450x672.jpg"
              alt=""
              className="w-72 h-82 object-cover"
            />
            <div className="product-des">
              <h3>Floral Dress</h3>
              <h4 className="price">$19.95</h4>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default trending;
